import './category.scss';

import React from 'react'

function CategoryPage({ match: { params: { categoryId } } }) {
    console.log('match.params.categoryId: ', categoryId);
    return (
        <div>
            <h2>Category page</h2>
        </div>
    )
}

export default CategoryPage
